import React, { Component, useState, useCallback } from "react";

export default class Header extends Component {
  render() {
    const fontColor = {
      fontSize: "50px",
      color: "lightgray"
    };
    const L = {
      color: "#766e6e"
    };
    const A = {
      color: "#847c78"
    };
    const H = {
      color: "#928a82"
    };
    const u = {
      color: "#b3afa5"
    };
    const g = {
      color: "#d4d4c8"
    };
    const h = {
      color: "#deccd6"
    };
    const e = {
      color: "#e7c3e4"
    };
    const s = {
      color: "#e6c392"
    };
    const M = {
      color: "#e5c33f"
    };
    const u2 = {
      color: "#b1a061"
    };
    const s2 = {
      color: "#7c7c83"
    };
    const i = {
      color: "#8e8e91"
    };
    const c = {
      color: "#9f9f9f"
    };
    return (
      <div className="header navbar-wrapper">
        <nav className="navbar">
          <a className="navbar-brand" href="#">
            <div>
              <span style="color:#766e6e;">L</span>
              <span style="color:#847c78;">A</span>
              <span style="color:#928a82;">H</span>
              <span style="color:#b3afa5;">u</span>
              <span style="color:#d4d4c8;">g</span>
              <span style="color:#deccd6;">h</span>
              <span style="color:#e7c3e4;">e</span>
              <span style="color:#e6c392;">s</span>
              <span style="color:#e5c33f;">M</span>
              <span style="color:#b1a061;">u</span>
              <span style="color:#7c7c83;">s</span>
              <span style="color:#8e8e91;">i</span>
              <span style="color:#9f9f9f;">c</span>
            </div>
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
              <li className="nav-item active">
                <a className="nav-link" href="#">
                  Home <span className="sr-only">(current)</span>
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">
                  Link
                </a>
              </li>
              <li className="nav-item">
                <a
                  className="nav-link disabled"
                  href="#"
                  tabindex="-1"
                  aria-disabled="true"
                >
                  Disabled
                </a>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    );
  }
}
